package tests

import org.junit.jupiter.api.Assertions
import org.junit.jupiter.api.Test
import org.junit.jupiter.api.TestInstance
import sideImplementations.GenomicRangeQuery

@TestInstance(TestInstance.Lifecycle.PER_CLASS)
class GenomicRangeQueryTest {

    @Test
    fun solutionTest() {
        var p = intArrayOf(2, 5, 0)
        var q = intArrayOf(4, 5, 6)
        var dnaSequence = "CAGCCTA"
        var expected = intArrayOf(2, 4, 1)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))

        p = intArrayOf(0)
        q = intArrayOf(0)
        dnaSequence = "A"
        expected = intArrayOf(1)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))

        p = intArrayOf(0)
        q = intArrayOf(0)
        dnaSequence = "C"
        expected = intArrayOf(2)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))

        p = intArrayOf(0)
        q = intArrayOf(0)
        dnaSequence = "G"
        expected = intArrayOf(3)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))

        p = intArrayOf(0)
        q = intArrayOf(0)
        dnaSequence = "T"
        expected = intArrayOf(4)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))

        dnaSequence = ""
        p = intArrayOf(0, 500)
        q = intArrayOf(49999, 49999)
        expected = intArrayOf(3, 3)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))

        p = intArrayOf(0, 0, 1)
        q = intArrayOf(0, 1, 1)
        dnaSequence = "GT"
        expected = intArrayOf(3, 3, 4)

        Assertions.assertArrayEquals(expected, GenomicRangeQuery.solution(dnaSequence, p, q))
    }

}
